 ('29', '55', 'en_us', 'Interior Dining Room Views', '<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill.  Relax and enjoy the sunset early in the evening, or spend the twilight hours dining  while encompassed by twinkling stars and city lights.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-05 03:11:52', '2017-04-06 18:28:00', '8ca6b792-22d1-43ae-9a44-4b58ee443591'),
