 ('62', '88', 'en_us', 'Wassef Haroun - Owner', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Wassef Haroun was born in Syria and raised in Lebanon before moving to the United States for school. After leaving a career in technology and computer science, Wassef turned to mamnoon as an experiment to bring the food and traditions of the levant to an American audience and to bridge the apparent gaps between the two cultures he inhabits. True to his geek background, Wassef has his hands in innumerable projects, big and small, around the restaurant in order to make the mamnoon experience universally compelling.', '2017-03-05 17:58:56', '2017-05-04 22:49:28', '8f6aa590-5b66-4b59-9c50-2644aa6698e0'),
 ('63', '89', 'en_us', 'Racha Haroun - Owner', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Racha Haroun was born in London, England to a Syrian father and Iranian mother. Racha came with her family to Houston, Texas from Damascus in 1982 where she attended college and met her husband Wassef. Racha grew up in a household where hospitality was prized and where both cuisines and palates were equally valued and integrated. Racha is deeply involved in the cultural community of Seattle and is a crucial part of the palate, menu development, and creative process behind the mamnoon aesthetic.', '2017-03-05 17:59:09', '2017-05-04 22:49:38', '13647960-d34b-4d99-83f4-c5e4d5a0208c'),
