 ('171', '201', 'en_us', 'Rainbow Chair', '<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather.  Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, the swinging rainbow egg will always be one of the most coveted seats in house.  The covered section of the patio bar is also available for private parties!  Please fill out the event request form below for more details.  <em>*insider tip* - if you\'re still feeling a little chilly, we have a selection of handcrafted quilts by local artist, Joey Veltkamp, to keep you cozy.</em></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-15 21:58:20', '2017-04-12 15:59:43', '1c89e31d-cc39-48ed-bb6e-a626d0448209'),
 ('172', '202', 'en_us', 'Patio Seaplane', '<p>Enjoy unparalleled views of South Lake Union and sip a martini while watching Duck Dodge sailboat races.  Quaff a beer and watch the seaplanes land.  Or hangout by the fire and make some new friends!</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-20 23:12:43', '2017-04-12 16:00:37', '8e56ac38-75a3-46fb-983d-6cc625315c3a'),
 ('174', '204', 'en_us', 'WE ARE CLOSED TODAY, MAY 9TH, FOR A PRIVATE FUNCTION.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Our Ground Control bar will remain open to the public and we hope to see you soon!', NULL, '2017-03-24 20:21:01', '2017-05-09 18:50:52', '9e190b07-9e71-46e7-a2f4-c12182056ad9'),
