 ('399', '88', '15', '1', 'en_us', '16', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Wassef Haroun - Owner\",\"slug\":\"wassef\",\"postDate\":1488736680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"1\":\"\",\"21\":[\"252\"],\"34\":\"Wassef Haroun was born in Syria and raised in Lebanon before moving to the United States for school. After leaving a career in technology and computer science, Wassef turned to mamnoon as an experiment to bring the food and traditions of the levant to an American audience and to bridge the apparent gaps between the two cultures he inhabits. True to his geek background, Wassef has his hands in innumerable projects, big and small, around the restaurant in order to make the mamnoon experience universally compelling.\"}}', '2017-05-04 22:49:29', '2017-05-04 22:49:29', '17dafca0-9fc0-4669-8fcd-a35264095e98'),
 ('400', '89', '15', '1', 'en_us', '12', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Racha Haroun - Owner\",\"slug\":\"racha\",\"postDate\":1488736740,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"1\":\"\",\"21\":[\"38\"],\"34\":\"Racha Haroun was born in London, England to a Syrian father and Iranian mother. Racha came with her family to Houston, Texas from Damascus in 1982 where she attended college and met her husband Wassef. Racha grew up in a household where hospitality was prized and where both cuisines and palates were equally valued and integrated. Racha is deeply involved in the cultural community of Seattle and is a crucial part of the palate, menu development, and creative process behind the mamnoon aesthetic.\"}}', '2017-05-04 22:49:38', '2017-05-04 22:49:38', '3fb1d236-bef6-4eb6-879b-0eca8b984c62'),
